VALUES ('20233815', '12 macarons Framboise, Chocolat, Pistache et Café', 'Sucre, eau, 13% _amandes_, farine de _blé_, beurre (_lait_), farine de maïs, _lait_ entier, préparation pour crème pâtissière (sucre, amidon modifié de pomme de terre, crème (_lait_) en poudre, dextrose, épaississant : alginate de sodium; sel, arôme naturel de vanille, colorant : caroténoïdes), 2,3% purée de framboise sucrée (2,1% framboise, sucre), 2,2% blanc d\'_oeuf_ en poudre (2,1% blanc d\'_oeuf_, correcteur d\'acidité: acide citrique; agent moussant: citrate de triéthyle), 1,7% chocolat noir (sucre, pâte de cacao, cacao maigre en poudre, beurre de cacao, émulsifiant: lécithines: arôme naturel de vanille), cacao maigre en poudre, 0,7% pâte de _pistache_, 0,6% extrait de café (0,3% café, sucre, eau), gélifiant: pectines; purée concentrée de citron (jus concentré de citron, correcteur d\'acidité: acide citrique; eau, pulpe de citron, sucre, citron), 0,07% café soluble, malt d\'_orge_, colorants: caroténoïdes, curcumine, complexes cuivre-chlorophylines, carmins; arôme _pistache_.', 'https://static.openfoodfacts.org/images/products/20233815/front_fr.6.400.jpg', '13.7', '4', '59.9', '51.3', '', '8.1', '0.14', '0.0551181102362205', '', '0');

