VALUES ('20280000', 'Pâté cuit au four', '000vengebakken paté. Ingredienten: 43% varkenslever, 38% varkensvlees, varkensvet, aardappelzetmeel, ui, zout, melkelwit, suiker, erwtenzetmeel, verdikkingsmiddet guarpitmeel; specerjen, stabilisatoren: difosfaten, polyfosfaten; antioxidanten: natriumascorbaat, kaliumlactaat natuurlijke aroma\'s, rjstmeel, conserveermiddelen: kaliumacetaten natriumnitriet. Kan sporen vam noten bevatten. Gekoeld bewaren bij max. +7°C. Na openen, binnen 3 dagen consumeren. Verpakt onder beschermende atmosfeer. Belangrik: de houdbaarheidsdatum op de verpakking kan enkel gegarandeerd worden bij een ononderbroken transport en bewaring bij max +7°C 0 Piaté cult au four. Ingrédlents: 43% foie de porc, 38% viande de porc, graisse de porc, amidon de pomme de terre, oignon, sel, protéines de lalt, sucre, amidon de pois, épaississant: gomme guar épices, stabilisants: diphosphates, polyphosphates; antioxydants: ascorbate de sodium, lactate de potassium; armes naturels, farine de riz, conservateurs acétates de potassium, nitrite de sodium. Peut contenir des traces de frults à coque.', 'https://static.openfoodfacts.org/images/products/20280000/front_fr.13.400.jpg', '19', '7.1', '3.1', '2.4', '', '18', '1.9', '0.748031496062992', '', '0');

